import React from "react"
import "./DownloadBtn.css"
import myCV from "../../assets/images/Moaz-Gad.pdf"

function DownloadBtn() {
  return (
    <a className=".button" href={myCV} download>
      Download CV
    </a>
  )
}

export default DownloadBtn
